Matrix<T, 18, 3> EoLRodSim::SGradientWrtx(Rod* rod, int rod_idx){
    TV xi, xj, Xi, Xj;
    auto node_i = rod->indices[rod_idx];
    auto node_j = rod->indices[rod_idx+1];
    rod->x(node_i, xi); rod->x(node_j, xj);
    rod->X(node_i, Xi); rod->X(node_j, Xj);
    Vector<T, 6> X; X.segment<3>(0) = Xi; X.segment<3>(3) = Xj; 
    Vector<T, 6> x; x.segment<3>(0) = xi; x.segment<3>(3) = xj; 
    TV N1 = rod->rest_tangents[rod_idx];
    Matrix<T, 9, 6> diff_S = dSdx(rod->E, X, x, N1);

    Matrix<T, 3, 9> diff_S_i = diff_S.block(0,0,9,3).transpose();
    Matrix<T, 3, 9> diff_S_j = diff_S.block(0,3,9,3).transpose();

    Matrix<T, 18, 3> res;
    for(int i = 0; i < 3; ++i){
        res.block(i*3, 0, 3, 3) = diff_S_i.block(0, i*3, 3, 3);
        res.block(i*3+9, 0, 3, 3) = diff_S_j.block(0, i*3, 3, 3);
    }

    return res;
}